import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={{ backgroundColor: '#008080', padding: '10px', color: 'white' }}>
      <h2 style={{ display: 'inline-block', marginRight: '20px' }}>FlashMaster</h2>
      <Link to="/" style={{ margin: '0 10px', color: 'white' }}>Home</Link>
      <Link to="/signup" style={{ margin: '0 10px', color: 'white' }}>Signup</Link>
      <Link to="/login" style={{ margin: '0 10px', color: 'white' }}>Login</Link>
      <Link to="/input" style={{ margin: '0 10px', color: 'white' }}>Upload</Link>
      <Link to="/review" style={{ margin: '0 10px', color: 'white' }}>Review Flashcards</Link>
      
      <Link to="/qnspeak" style={{ color: "white" }}>Qn Speak</Link>
      <Link to="/quiz" style={{ color: "white" }}>Quiz</Link>
      

    </nav>
  );
};

export default Navbar;
